import React from "react";
import AppLayout from "../components/AppLayout";

const Home = () => {
    return (
        <>
            <Head>
                <title>Node Bird</title>
            </Head>
            <AppLayout>
                <div>Hello, Next!</div>
            </AppLayout>
        </>
    );
};

export default Home;
